import dashboard from '../../assets/dev_track_dashboard.png';
import contacts from '../../assets/dev_track_contacts.png';
import login from '../../assets/dev_track_login.png';
import application from '../../assets/dev_track_app.png';

export const project_images = [
   {src: `${dashboard}`, alt: "dashboard"},
   {src: `${contacts}`, alt: "contacts"},
   {src: `${login}`, alt: "login"},
   {src: `${application}`, alt: "application"},
]
